const l=JSON.parse('{"key":"v-d42da57a","path":"/storehouse/Flowchart%20judgment.html","title":"","lang":"zh-CN","frontmatter":{},"headers":[],"git":{"createdTime":null,"updatedTime":null,"contributors":[]},"readingTime":{"minutes":0.69,"words":207},"filePathRelative":"storehouse/Flowchart judgment.md","excerpt":"<ul>\\n<li>\\n<ol>\\n<li>流程图的if和while区别在于是否菱形方框是回转的。</li>\\n</ol>\\n</li>\\n<li>\\n<ol start=\\"2\\">\\n<li>大脑很笨的，你很笨的每次只能够专心做一件事情。所以什么程序都必须先画流程图，然后再写代码,不然你的大脑就开始害怕了。</li>\\n</ol>\\n</li>\\n<li>\\n<ol start=\\"3\\">\\n<li>流程图的if条件里面的话往下走，不要往结束的走。</li>\\n</ol>\\n</li>\\n<li>\\n<ol start=\\"4\\">\\n<li>流程图严格按照运行的样子，代码严格按照流程图，不然失之豪厘差之千里。</li>\\n</ol>\\n</li>\\n<li>\\n<ol start=\\"5\\">\\n<li>不要想着画一个流程图就一劳永逸了，在流程图里面如果不够详细，就在代码里面列出1,2,3,4.</li>\\n</ol>\\n</li>\\n<li>\\n<ol start=\\"6\\">\\n<li>用流程图找到三个运动的结果，通过三个运动的结果找到三个改变运动的状态条件。</li>\\n</ol>\\n</li>\\n</ul>"}');export{l as data};
